import React from 'react';
import Button from 'react-bootstrap/Button';
import DropDown from 'react-bootstrap/DropdownButton';

import './styles.css';

class Navbar extends React.Component {
    render(){

        return(
            <nav class="navbar navbar-light bg-light">
                <div class="container-fluid">
                    <a class="navbar-brand" href="#">DESTINY 9 to 5</a>
                    <Button type="button" class="btn btn-primary">Login</Button>
                    <DropdownButton menuAlign="right" title="Dropdown right" id="dropdown-menu-align-right">
                        <Dropdown.Item eventKey="1">Hunter</Dropdown.Item>
                        <Dropdown.Item eventKey="2">Titan</Dropdown.Item>
                        <Dropdown.Item eventKey="3">Warlock</Dropdown.Item>
                        <Dropdown.Item eventKey="4">Separated link</Dropdown.Item>
                    </DropdownButton>
                </div>
               
            </nav>)
    }
}

export default Navbar
